```javascript
const { Client, Collection, DiscordApi } = require('discord.js');

// Replace 'your_bot_token' with your bot token
const client = new Client({ intents: [DiscordApi.Intents.FLAGS.GUILD_BANNER, DiscordApi.Intents.FLAGS.GUILDS, DiscordApi.Intents.FLAGS.GUILD_MESSAGES] });
client.commands = new Collection();

// Register the ban command
client.commands.set(new Discord.SlashCommandBuilder()
 .setName('ban')
 .setDescription('Ban a user from the server.')
 .addUserOption(option => option.setName('target').setDescription('The user to ban'))
 .addIntegerOption(option => option.setName('days').setDescription('Number of days banned'))
);

client.once('ready', () => {
  console.log('Your bot is online!');
});

client.on('interactionCreate', async interaction => {
  if (!interaction.isCommand()) return;

  const { commandName } = interaction;

  if (commandName === 'ban') {
    const { options } = interaction;
    const target = options.getUser('target');
    const days = options.getInteger('days');

    try {
      await interaction.guild.bans.add(target, `Banned by ${interaction.user} for ${days} days`);
      interaction.reply({ content: `Successfully banned ${target} for ${days} days.`, ephemeral: true });
    } catch (error) {
      console.error(`Error banning ${target}: ${error}`);
      interaction.reply({ content: 'There was an error banning this user.', ephemeral: true });
    }
  }
});

client.login('your_bot_token');
```
