function checkPrime(arr) {
  for (let i = 0; i < arr.length; i++) {
    let num = arr[i];
    if (isPrime(num)) {
      console.log(num);
    }
  }
}

function isPrime(num) {
  if (num < 2) {
    return false;
  } else if (num === 2) {
    return true;
  } else {
    for (let i = 2; i <= Math.sqrt(num); i++) {
      if (num % i === 0) {
        return false;
      }
    }
    return true;
  }
}
```
