The `isPrime` function checks if a given number is prime or not. It uses a similar approach as the Sieve of Eratosthenes algorithm. The function first checks if the number is less than 2, in which case it is not a prime number. Then it checks if the number is 2, which is a prime number itself. Finally, it loops through numbers from 2 to the square root of the given number. If the number is divisible by any of these numbers, it is not a prime number. If it is not divisible by any of them, it is a prime number.

